                    { 66, 1, false, "[{\"AttaqueId\":0,\"Type\":\"Fighting\",\"Name\":\"Low Kick\",\"Damage\":4.15,\"Id\":0},{\"AttaqueId\":0,\"Type\":\"Fighting\",\"Name\":\"Karate Chop\",\"Damage\":3.75,\"Id\":0},{\"AttaqueId\":0,\"Type\":\"Fighting\",\"Name\":\"Low Sweep\",\"Damage\":6.65,\"Id\":0},{\"AttaqueId\":0,\"Type\":\"Fighting\",\"Name\":\"Brick Break\",\"Damage\":9.4,\"Id\":0},{\"AttaqueId\":0,\"Type\":\"Fighting\",\"Name\":\"Cross Chop\",\"Damage\":15.0,\"Id\":0}]", 1, "Machop exercises by hefting around a Graveler as if it were a barbell. There are some Machop that travel the world in a quest to master all kinds of martial arts.  Machop's muscles are special—they never get sore no matter how much they are used in exercise. This Pokémon has sufficient power to hurl a hundred adult humans.", "{\"Level\":28,\"To\":\"Machoke\",\"Id\":0}", 70, "/Resources/Images/66.png", 1, "Machop", 100, "[\"Fighting\"]" },
