                    { 68, 1, false, "[{\"AttaqueId\":0,\"Type\":\"Steel\",\"Name\":\"Bullet Punch\",\"Damage\":4.15,\"Id\":0},{\"AttaqueId\":0,\"Type\":\"Fighting\",\"Name\":\"Karate Chop\",\"Damage\":3.75,\"Id\":0},{\"AttaqueId\":0,\"Type\":\"Rock\",\"Name\":\"Stone Edge\",\"Damage\":12.9,\"Id\":0},{\"AttaqueId\":0,\"Type\":\"Fighting\",\"Name\":\"Submission\",\"Damage\":7.15,\"Id\":0},{\"AttaqueId\":0,\"Type\":\"Fighting\",\"Name\":\"Cross Chop\",\"Damage\":15.0,\"Id\":0}]", 1, "Machamp is known as the Pokémon that has mastered every kind of martial arts. If it grabs hold of the foe with its four arms, the battle is all but over. The hapless foe is thrown far over the horizon.  Machamp has the power to hurl anything aside. However, trying to do any work requiring care and dexterity causes its arms to get tangled. This Pokémon tends to leap into action before it thinks.", "{\"Level\":1,\"To\":\"\",\"Id\":0}", 90, "/Resources/Images/68.png", 1, "Machamp", 100, "[\"Fighting\"]" },
