                    { 73, 1, false, "[{\"AttaqueId\":0,\"Type\":\"Poison\",\"Name\":\"Acid\",\"Damage\":4.75,\"Id\":0},{\"AttaqueId\":0,\"Type\":\"Poison\",\"Name\":\"Poison Jab\",\"Damage\":5.7,\"Id\":0},{\"AttaqueId\":0,\"Type\":\"Water\",\"Name\":\"Hydro Pump\",\"Damage\":11.85,\"Id\":0},{\"AttaqueId\":0,\"Type\":\"Poison\",\"Name\":\"Sludge Wave\",\"Damage\":10.3,\"Id\":0},{\"AttaqueId\":0,\"Type\":\"Ice\",\"Name\":\"Blizzard\",\"Damage\":12.8,\"Id\":0}]", 1, "Tentacruel has tentacles that can be freely elongated and shortened at will. It ensnares prey with its tentacles and weakens the prey by dosing it with a harsh toxin. It can catch up to 80 prey at the same time.  Tentacruel has large red orbs on its head. The orbs glow before lashing the vicinity with a harsh ultrasonic blast. This Pokémon's outburst creates rough waves around it.", "{\"Level\":1,\"To\":\"\",\"Id\":0}", 80, "/Resources/Images/73.png", 1, "Tentacruel", 100, "[\"Poison\",\"Water\"]" },
                    { 58, 1, false, "[{\"AttaqueId\":0,\"Type\":\"Fire\",\"Name\":\"Ember\",\"Damage\":4.75,\"Id\":0},{\"AttaqueId\":0,\"Type\":\"Dark\",\"Name\":\"Bite\",\"Damage\":6.0,\"Id\":0},{\"AttaqueId\":0,\"Type\":\"Fire\",\"Name\":\"Flame Wheel\",\"Damage\":4.35,\"Id\":0},{\"AttaqueId\":0,\"Type\":\"Normal\",\"Name\":\"Body Slam\",\"Damage\":12.8,\"Id\":0},{\"AttaqueId\":0,\"Type\":\"Fire\",\"Name\":\"Flamethrower\",\"Damage\":9.5,\"Id\":0}]", 1, "Growlithe has a superb sense of smell. Once it smells anything, this Pokémon won't forget the scent, no matter what. It uses its advanced olfactory sense to determine the emotions of other living things.  Growlithe has a superb sense of smell. Once it smells anything, this Pokémon won't forget the scent, no matter what. It uses its advanced olfactory sense to determine the emotions of other living things.", "{\"Level\":1,\"To\":\"\",\"Id\":0}", 55, "/Resources/Images/58.png", 1, "Growlithe", 100, "[\"Fire\"]" },
