                    { 55, 1, false, "[{\"AttaqueId\":0,\"Type\":\"Water\",\"Name\":\"Water Gun\",\"Damage\":6.0,\"Id\":0},{\"AttaqueId\":0,\"Type\":\"Psychic\",\"Name\":\"Confusion\",\"Damage\":4.95,\"Id\":0},{\"AttaqueId\":0,\"Type\":\"Psychic\",\"Name\":\"Psychic\",\"Damage\":9.8,\"Id\":0},{\"AttaqueId\":0,\"Type\":\"Water\",\"Name\":\"Hydro Pump\",\"Damage\":11.85,\"Id\":0},{\"AttaqueId\":0,\"Type\":\"Ice\",\"Name\":\"Ice Beam\",\"Damage\":8.9,\"Id\":0}]", 1, "Golduck is the fastest swimmer among all Pokémon. It swims effortlessly, even in a rough, stormy sea. It sometimes rescues people from wrecked ships floundering in high seas.  The webbed flippers on its forelegs and hind legs and the streamlined body of Golduck give it frightening speed. This Pokémon is definitely much faster than even the most athletic swimmer.", "{\"Level\":1,\"To\":\"\",\"Id\":0}", 80, "/Resources/Images/55.png", 1, "Golduck", 100, "[\"Water\"]" },
