                    { 40, 1, false, "[{\"AttaqueId\":0,\"Type\":\"Normal\",\"Name\":\"Pound\",\"Damage\":6.5,\"Id\":0},{\"AttaqueId\":0,\"Type\":\"Dark\",\"Name\":\"Feint Attack\",\"Damage\":5.75,\"Id\":0},{\"AttaqueId\":0,\"Type\":\"Fairy\",\"Name\":\"Dazzling Gleam\",\"Damage\":6.55,\"Id\":0},{\"AttaqueId\":0,\"Type\":\"Normal\",\"Name\":\"Hyper Beam\",\"Damage\":12.0,\"Id\":0},{\"AttaqueId\":0,\"Type\":\"Fairy\",\"Name\":\"Play Rough\",\"Damage\":9.5,\"Id\":0}]", 1, "Wigglytuff's body is very flexible. By inhaling deeply, this Pokémon can inflate itself seemingly without end. Once inflated, Wigglytuff bounces along lightly like a balloon.  Wigglytuff has large, saucerlike eyes. The surfaces of its eyes are always covered with a thin layer of tears. If any dust gets in this Pokémon's eyes, it is quickly washed away.", "{\"Level\":1,\"To\":\"\",\"Id\":0}", 140, "/Resources/Images/40.png", 1, "Wigglytuff", 100, "[\"Normal\",\"Fairy\"]" },
