                    { 42, 1, false, "[{\"AttaqueId\":0,\"Type\":\"Flying\",\"Name\":\"Wing Attack\",\"Damage\":6.0,\"Id\":0},{\"AttaqueId\":0,\"Type\":\"Dark\",\"Name\":\"Bite\",\"Damage\":6.0,\"Id\":0},{\"AttaqueId\":0,\"Type\":\"Poison\",\"Name\":\"Poison Fang\",\"Damage\":5.2,\"Id\":0},{\"AttaqueId\":0,\"Type\":\"Flying\",\"Name\":\"Air Cutter\",\"Damage\":4.55,\"Id\":0},{\"AttaqueId\":0,\"Type\":\"Ghost\",\"Name\":\"Ominous Wind\",\"Damage\":4.85,\"Id\":0}]", 1, "Golbat bites down on prey with its four fangs and drinks the victim's blood. It becomes active on inky Dark moonless nights, Flying around to attack people and Pokémon.  Golbat loves to drink the blood of living things. It is particularly active in the pitch black of night. This Pokémon flits around in the night skies, seeking fresh blood.", "{\"Level\":1,\"To\":\"\",\"Id\":0}", 75, "/Resources/Images/42.png", 1, "Golbat", 100, "[\"Flying\",\"Poison\"]" },
                    { 43, 1, false, "[{\"AttaqueId\":0,\"Type\":\"Grass\",\"Name\":\"Razor Leaf\",\"Damage\":5.15,\"Id\":0},{\"AttaqueId\":0,\"Type\":\"Poison\",\"Name\":\"Acid\",\"Damage\":4.75,\"Id\":0},{\"AttaqueId\":0,\"Type\":\"Grass\",\"Name\":\"Seed Bomb\",\"Damage\":8.35,\"Id\":0},{\"AttaqueId\":0,\"Type\":\"Poison\",\"Name\":\"Sludge Bomb\",\"Damage\":10.6,\"Id\":0},{\"AttaqueId\":0,\"Type\":\"Fairy\",\"Name\":\"Moonblast\",\"Damage\":10.35,\"Id\":0}]", 1, "Oddish searches for fertile, nutrient-rich soil, then plants itself. During the daytime, while it is planted, this Pokémon's feet are thought to change shape and become similar to the roots of trees.  During the daytime, Oddish buries itself in soil to absorb nutrients from the Ground using its entire body. The more fertile the soil, the glossier its leaves become.", "{\"Level\":21,\"To\":\"Gloom\",\"Id\":0}", 45, "/Resources/Images/43.png", 1, "Oddish", 100, "[\"Poison\",\"Grass\"]" },
                    { 44, 1, false, "[{\"AttaqueId\":0,\"Type\":\"Grass\",\"Name\":\"Razor Leaf\",\"Damage\":5.15,\"Id\":0},{\"AttaqueId\":0,\"Type\":\"Poison\",\"Name\":\"Acid\",\"Damage\":4.75,\"Id\":0},{\"AttaqueId\":0,\"Type\":\"Grass\",\"Name\":\"Petal Blizzard\",\"Damage\":10.15,\"Id\":0},{\"AttaqueId\":0,\"Type\":\"Poison\",\"Name\":\"Sludge Bomb\",\"Damage\":10.6,\"Id\":0},{\"AttaqueId\":0,\"Type\":\"Fairy\",\"Name\":\"Moonblast\",\"Damage\":10.35,\"Id\":0}]", 1, "From its mouth Gloom drips honey that smells absolutely horrible. Apparently, it loves the horrid stench. It sniffs the noxious fumes and then drools even more of its honey.  Gloom releases a foul fragrance from the pistil of its flower. When faced with danger, the stench worsens. If this Pokémon is feeling calm and secure, it does not release its usual stinky aroma.", "{\"Level\":1,\"To\":\"\",\"Id\":0}", 60, "/Resources/Images/44.png", 1, "Gloom", 100, "[\"Poison\",\"Grass\"]" },
